import Vue from 'vue';
import Router from 'vue-router';

import AulasHome from '../components/AulasHome.vue';


Vue.use(Router);

const routes = [
  { path: '/', name: 'AulasHome', component: AulasHome },

];

const router = new Router({
  mode: 'history',
  base: process.env.BASE_URL,
  routes
});

export default router;
